        var ConfirmDelete = function (NewsId) {
            $(""#hiddennewsid"").val(NewsId);
            $(""#newsModal"").modal('show');
        }

        var DeleteNews = function () {
            var newsid = $(""#hiddennewsid"").val();
            $.ajax({
                type: ""POST"",
                url: ""DeleteNews"",
                data: {
                    ""Id"": newsid
                },
                success: function (result) {
                    $(""#newsModal"").modal(""hide"");
                    $(""#row_"" + newsid).remove();
                    $(""#col_"" + newsid).remove();
                }
            })
        }

    </script>
